import React from 'react';
import Head from 'next/head';

import AppLayout from '../components/AppLayout';

const Rank = () => (
  <>
    <Head>
      <title>Study Board | Rank</title>
    </Head>
    <AppLayout>
      <div>Rank</div>
    </AppLayout>
  </>
);

export default Rank;
